import PropTypes from "prop-types";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import * as loadingAct from "../../Components/redux/actions/loadingAct";

 const hideLoading = (props)=>{
  props.loadingActionCreators.hideLoading();
}


hideLoading.propTypes = {
  loading: PropTypes.bool,
};
const mapDispatchToProps = (dispatch) => {
  return {
    loadingActionCreators: bindActionCreators(loadingAct, dispatch),
  };
};

export default connect(mapDispatchToProps)(hideLoading);
